import React from 'react'
import { useDispatch } from 'react-redux'
import { SetPageTitle } from '../../../_redux/_appStateStore/appStoreAccessor';
import LogTable from '../../../_components/_virtualized/_table/Table';
import { AutoSizer, Index } from 'react-virtualized';
import TableColunm from '../../../_components/_virtualized/_table/TableColunm';
import { Grid } from '@material-ui/core';
import { ILogmessageRow } from './interfaces/ILogMessageRow';
import TableCell from '../../../_components/_virtualized/_table/TableCell';

interface IProps{
    logmessages: ILogmessageRow[]
    selectedItems: number[]
    handleSelectedItems: (items: number[]) => void
}

const LoggingPageContainer: React.FC<IProps> = (props) =>{

    const {logmessages, selectedItems, handleSelectedItems} = props
    const dispatch = useDispatch();

    dispatch(SetPageTitle("Administration - Logging"))
  
    const rowGetter = React.useCallback((row: Index) =>{
        return logmessages[row.index]
    },[logmessages])

    const handleSelect = React.useCallback((id: number) =>{
        const items = selectedItems
        items.push(id)
        handleSelectedItems(items)
    },[selectedItems, handleSelectedItems])

    const cellRenderer = React.useCallback((cellData: any, dataKey: string, index: number) =>{
        return(
            <TableCell id={logmessages[index].id} value={cellData} checked={selectedItems.find(x => x) !== -1} hasCheckbox={dataKey==='id'} handleSelect={handleSelect} />
        )
    },[logmessages, handleSelect])

    return(
        <Grid container>
            <AutoSizer disableHeight>
                {({width}) =>(
                <LogTable 
                    height={800} 
                    width={width} 
                    rowHeight={50} 
                    rowCount={logmessages.length} 
                    headerHeight={100}
                    logmessages={logmessages}
                    getRow={rowGetter}
                    >
                    {TableColunm({key: "0", dataKey: 'id', width: 150, headerValue:"ID", customCellRenderer: cellRenderer })}
                    {TableColunm({key: "1", dataKey: 'timeStamp', width: 300, headerValue: "Date", customCellRenderer: cellRenderer})}
                    {TableColunm({key: "2", dataKey: 'messageType', width: 300, headerValue: "Type", customCellRenderer: cellRenderer})}
                    {TableColunm({key: "3", dataKey: 'message', width: 500, headerValue: "Message", customCellRenderer: cellRenderer})}
                    {TableColunm({key: "4", dataKey: 'exception', width: 500, headerValue: "Exception", customCellRenderer: cellRenderer})}
                </LogTable>
            )}
            </AutoSizer>
        </Grid>
    )
}

export default LoggingPageContainer
